(function($,window,document,undefined){"use strict";$('div[data-role="portfolio"]').each(function(){$(this).cubeportfolio({loadMoreAction:"click",layoutMode:"grid",mediaQueries:[{width:1500,cols:5},{width:1100,cols:4},{width:800,cols:3},{width:480,cols:2},{width:320,cols:1}],defaultFilter:"*",animationType:"rotateSides",gapHorizontal:10,gapVertical:10,gridAdjustment:"responsive",caption:"zoom",displayType:"sequentially",displayTypeSpeed:100,lightboxDelegate:".cbp-lightbox",lightboxGallery:true,lightboxTitleSrc:"data-title",lightboxCounter:'<div class="cbp-popup-lightbox-counter">{{current}} of {{total}}</div>',singlePageInlineDelegate:".cbp-singlePageInline",singlePageInlinePosition:"below",singlePageInlineInFocus:true,singlePageInlineCallback:function(url,element){var t=this;$.ajax({url:url,type:"GET",dataType:"html",timeout:1e4}).done(function(result){t.updateSinglePageInline(result)}).fail(function(){t.updateSinglePageInline("AJAX Error! Please refresh the page! "+url)})}})})})(jQuery,window,document);